pre-processors.html.body:
Pré-Processadores
Este boilerplate já vem configurado com extração de CSS dos pré-processadores de CSS mais populares, incluindo LESS, Sass, Stylus e PostCSS. Para utilizar um pré-processador, tudo que você precisa fazer é instalar o seu respectivo loader Webpack. Por exemplo, para usar Sass:
npm install sass-loader node-sass --save-dev

Observe que você também precisa instalar node-sass porque o sass-loader depende dele (como peer dependency).
Usando pré-processadores em componentes
Uma vez instalado, para usar um pré-processador em seus componentes *.vue, defina o atributo lang na tag :

/* write Sass! */


Nota sobre a sintaxe Sass

lang="scss" corresponde à sintaxe que estende CSS (a com chaves - { e } - e ponto-e-vírgula).
lang="sass" corresponde à sintaxe que requer indentação.

PostCSS
Blocos style em arquivos *.vue e arquivos de stylesheets (*.css, *.scss etc) são passados pelo PostCSS por padrão, portanto não é necessário usar outro loader para ele.
Você pode simplesmente adicionar os plugins do PostCSS que você deseja usar ao arquivo .postcssrc.js que se encontra no diretório raiz do seu projeto:
// https://github.com/michael-ciniawsky/postcss-load-config

module.exports = {
  "plugins": {
    // para editar os browsers-alvo: use o campo "browserslist" do seu package.json
    "postcss-import": {},
    "autoprefixer": {}
  }
}

Veja a documentação relacionada do vue-loader para mais detalhes.
Arquivos CSS separados
Para garantir consistência na extração e processamento do seu CSS, é recomendável que os arquivos de stylesheets globais sejam importados no seu componente App.vue raiz. Por exemplo:



Observe que você provavelmente só deve fazer isto com as stylesheets que você mesmo escreveu para sua aplicação. Bibliotecas já existentes, como Bootstrap ou Semantic UI, podem ser postas dentro de /static e referenciadas diretamente em index.html. Isto evita tempo adicional gasto durante o build e traz melhorias no caching nos browsers. (Veja Lidando com Assets Estáticos)

static.html.body:
Lidando com Assets Estáticos
Você notará que na estrutura do projeto temos dois diretórios para assets estáticos: src/assets e static/. Qual a diferença entre os dois?
Assets passados pelo Webpack
Para responder a essa questão, primeiro temos que entender como o Webpack lida com assets estáticos. Em componentes *.vue, todos seus templates e CSS são analisados por vue-html-loader e css-loader a procura de URLs de assets. Por exemplo, em  e background: url(./logo.png), "./logo.png" é um path relativo de asset e será reconhecido pelo Webpack como uma dependência de módulo.
Como logo.png não é JavaScript, quando tratado como uma dependência de módulo, precisamos usar url-loader e file-loader para processá-lo. Este template já vem como esses loaders configurados, oferecendo assim alguns recursos como fingerprinting (identificação única de uma versão de um arquivo), e inlining em base64 (inclusão do conteúdo do asset no código compilado), e permite usar paths relativos/de módulo sem se preocupar com deployment.
Considerando que esses assets podem ser incluídos via inlining, copiados ou renomeados durante o build, eles essencialmente fazem parte do seu código-fonte. É por isto que recomendamos pôr assets estáticos dentro de /src, junto de outros arquivos do seu código-fonte. Na verdade, você nem precisa pôr todos eles em /src/assets: você pode organizá-los com base em qual módulo/componente vai usá-los. Por exemplo, você pode pôr cada componente em seu próprio diretório, com seus assets estáticos a seu lado.
Regras de reconhecimento de assets

URLs relativos, por exemplo ./assets/logo.png, serão interpretados como dependências de módulo. Eles serão substituídos por um URL automaticamente gerado baseado nas suas configurações de output (escrita) do Webpack.

URLs sem prefixo, por exemplo assets/logo.png, serão tratados da mesma forma que URLs relativos, tornando-se ./assets/logo.png.

URLs com prefixo ~ são tratados como uma requisição de módulo, similar a require('some-module/image.png'). Você deve usar esse prefixo se quiser fazer uso das configurações de resolução de módulos do Webpack. Por exemplo, se você definir um alias (caminho alternativo/atalho) de resolução para assets, deverá usar  para garantir que esse alias seja utilizado.

URLs relativos à raiz, por exemplo /assets/logo.png, não são processados.


Obter localizações de assets no JavaScript
Para que o Webpack retorne localizações corretas dos assets, você deve usar require('./relative/path/to/file.jpg'), que é processado por file-loader e retorna o URL reconhecido. Por exemplo:
computed: {
  background () {
    return require('./bgs/' + this.id + '.jpg')
  }
}

Observe que o exemplo acima incluirá todas as imagens que estejam em ./bgs/ no build final. Isto ocorre porque o Webpack não tem como identificar qual delas será usada quando o código estiver rodando, portanto precisa incluir todas.
Assets estáticos "de verdade"
Em contraste, arquivos em static/ não são nunca processados pelo Webpack: eles são copiados diretamente para seu destino final sem modificações, e com o mesmo nome de arquivo. Referências a esses arquivos precisam ser feitas com paths absolutos, que são determinados através da junção de build.assetsPublicPath e build.assetsSubDirectory do arquivo config.js.
Para exemplificar, usando os seguintes valores padrão:
// config/index.js
module.exports = {
  // ...
  build: {
    assetsPublicPath: '/',
    assetsSubDirectory: 'static'
  }
}

Qualquer arquivo posto em static/ deverá ser referenciado usando o URL absoluto /static/[filename]. Se você mudar assetSubDirectory para assets, esses URLS precisam ser mudados para /assets/[filename].
Nós vamos aprender mais sobre o arquivo de configuração na seção sobre integração com backend.

proxy.html.body:
Proxying de APIs Durante o Desenvolvimento
Ao integrar este boilerplate com um backend já existente, é comum a necessidade de acessar a API do backend enquanto se usa o servidor de desenvolvimento. Para fazer isto, nós podemos rodar o servidor de desenvolvimento e a API lado a lado (ou de forma remota), e deixar que o servidor de desenvolvimento faça proxy de todas as requisições da API ao verdadeiro backend.
Para configurar as regras de proxy, edite a opção dev.proxyTable em config/index.js. O servidor de desenvolvimento usa http-proxy-middleware para proxying, portanto você deve consultar a documentação dele para detalhes sobre seu uso. Eis um exemplo simples:
// config/index.js
module.exports = {
  // ...
  dev: {
    proxyTable: {
      // fazer proxy de todas requisições que comecem com /api a jsonplaceholder
      '/api': {
        target: 'http://jsonplaceholder.typicode.com',
        changeOrigin: true,
        pathRewrite: {
          '^/api': ''
        }
      }
    }
  }
}

O exemplo acima fará proxy da requisição /api/posts/1 a http://jsonplaceholder.typicode.com/posts/1.
Matching (identificação) de URLs
Além de URLs estáticos, você também pode usar glob patterns para identificar URLs, por exemplo /api/**. Veja Context Matching para mais detalhes. Além disto, você pode informar uma opção filter, que pode ser uma função personalizada para determinar se uma requisição deve passar por proxy:
proxyTable: {
  '**': {
    target: 'http://jsonplaceholder.typicode.com',
    filter: function (pathname, req) {
      return pathname.match('^/api') && req.method === 'GET'
    }
  }
}

prerender.html.body:
Pré-renderização para SEO
Se você deseja pré-renderizar rotas que não mudarão significativamente depois de enviadas para produção, use esse plugin do Webpack: prerender-spa-plugin, que foi testado para uso com Vue. Para páginas que de fato mudam frequentemente, Prerender.io e Netlify oferecem planos que frequentemente pré-renderizam seu conteúdo, para uso de ferramentas de busca.
Usando o prerender-spa-plugin

Instale como dev dependency:

npm install --save-dev prerender-spa-plugin


Importe em build/webpack.prod.conf.js:

// Esta linha deve ser posta no topo do arquivo onde os outros 'imports' estão
const PrerenderSpaPlugin = require('prerender-spa-plugin')


Configure-o na array plugins (igualmente em build/webpack.prod.conf.js):

new PrerenderSpaPlugin(
  // Localização da aplicação depois de compilada
  path.join(__dirname, '../dist'),
  // Lista de endpoints (caminhos) que você deseja pré-renderizar
  [ '/' ]
)

Se você quisesse pré-renderizar também /about e /contact, então essa array seria [ '/', '/about', '/contact' ].

Ative o modo history do vue-router:const router = new VueRouter({
mode: 'history',
routes: [...]
})
